import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import MainLayout from './components/Layout/MainLayout';
import SalesList from './components/Sales/SalesList';
import SaleForm from './components/Sales/SaleForm';
import HumansList from './components/Humans/HumansList';
import HumanForm from './components/Humans/HumanForm';
import QueryForm from './components/Queries/QueryForm';

const App = () => (
    <Router>
        <MainLayout>
            <Switch>
                <Route path="/sales" exact component={SalesList} />
                <Route path="/sales/new" component={SaleForm} />
                <Route path="/humans" exact component={HumansList} />
                <Route path="/humans/new" component={HumanForm} />
                <Route path="/humans/edit/:id" component={HumanForm} />
                <Route path="/queries" component={QueryForm} />
            </Switch>
        </MainLayout>
    </Router>
);

export default App;
